class Solution:
    def findAnagrams(self, s: str, p: str):
        s_len, p_len = len(s), len(p)
        res = []
        if s_len < p_len:
            return []
        p_counter = Counter(p)
        s_counter = Counter()
        print("p counter is ", p_counter)
        print("s counter is ", s_counter)
        for i in range(s_len):
            s_counter[s[i]] += 1
            if i >= p_len:
                if s_counter[s[i - p_len]] == 1:
                    del s_counter[s[i - p_len]]
                else:
                    s_counter[s[i - p_len]] -= 1
            if s_counter == p_counter:
                res.append(i - p_len + 1)
        return res


def main():
    p = Solution()
    print(p.findAnagrams("", "yqrbgjdwtcaxzsnifvhmou"))


if __name__ == "__main__":
    main()
